edition = "2023";

package youtube.api.innertube;

import "youtube/api/innertube/renderer.proto";
import "youtube/api/innertube/formatted_string.proto";
import "youtube/api/innertube/icon.proto";
import "youtube/api/innertube/command.proto";
import "youtube/api/innertube/accessibility_supported_datas.proto";

option java_package = "com.google.protos.youtube.api.innertube";
option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "YTI";

message UnpluggedMultiselectPopupToggleServiceItemRenderer {
	extend Renderer {
		UnpluggedMultiselectPopupToggleServiceItemRenderer unplugged_multiselect_popup_toggle_service_item_renderer = 162642067;
	}

	FormattedString default_text = 1;
	Icon default_icon = 2;
	Command default_endpoint = 3;
	FormattedString toggled_text = 4;
	Icon toggled_icon = 5;
	Command toggled_endpoint = 6;
	bool is_toggled = 7;
	AccessibilitySupportedDatas accessibility = 8;
	bytes tracking_params = 10;
}
